import { css } from "@emotion/css";
import styled from "@emotion/styled";

const color = "white";
const Button = styled.button`
  padding: 32px;
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  color: black;
  font-weight: bold;
  &:hover {
    color: white;
  }
`;

function Card() {
  return <div></div>;
}

export default Card;
